import React from 'react'
import ReactDOM from 'react-dom'
import axios from 'axios';
import { Provider } from 'react-redux'
import { createStore } from 'redux'

import rootReducer from '../reducers'
import App from '../components/App'
//import {data} from '../components/DownloadData'

import downloadData from '../actions'



function callData() {
	axios.post('http://test1.hokhang.com/hksCloudService/getEventService.php?appId=119871&dataGroupCode=01&primaryCategory=&secondarCategory=&index=0&limit=30&lat=25.000000&lon=121.000000'
	).then(function (response) {
		dispatch(downloadData(response.branch));
		console.log(response.branch);
	}).catch(function (error) {
	});
}

callData();



const store = createStore(rootReducer);


function Index() {
	return (
		<Provider store={store}>
			<App />
		</Provider>
	)
}

export default Index
